function CardListItem(props) {
    return (
        <li>{props.item}</li>
    )
}

function ProjectCard(props)  {

    let listItems=[]
    props.items.forEach((listItem) => {
        listItems.push(<CardListItem item={listItem}></CardListItem>)
    });

    return (
        <div className="rounded-xl border-4 border-blue-800 px-16 pt-5 pb-5 w-96 h-96">
            <h2 className="text-center text-3xl font-bold text-blue-800 whitespace-normal">{props.title}</h2>
            <div className="flex flex-col outline h-full items-end">
                <div className="mx-auto mt-4 text-xl font-medium text-purple-700">
                    <ul className="list-disc">
                        {listItems}
                    </ul>
                </div>
                <div className="flex items-end justify-center outline">
                    <a href="" className="mx-2 px-5 py-2 bg-blue-500 font-bold text-white rounded-md">Live Demo</a>
                    <a href="" className="mx-2 px-5 py-2 bg-blue-500 font-bold text-white rounded-md">GitHub</a>
                </div>
            </div>
        </div>
    )
}


export let ProjectPage = (props) => {
    let projectCards = []

    let projects = [
        {
            "title": 'My Website',
            "things": ["ReactJS", "JavaScript", "React-Router", "HTML", "TailWindCSS", "NodeJS"]
        },
        {
            "title": "School Database Project",
            "things": ["JavaScript", "ExpressJS", "NodeJS", "BootStrap", "HTML", "MySQL"]
        },
        {
            "title": "Turtle Creek Website",
            "things": ["JavaScript", "ExpressJS", "NodeJS", "BootStrap", "HTML"]
        },
        {
            "title": "Elmer Collision Website",
            "things": ["JavaScript", "ExpressJS", "NodeJS", "BootStrap", "HTML"]
        }
    ]

    projects.forEach((project) => {
        projectCards.push(
        <div className="flex-1 shrink" style={{flex: '0 0 auto'}}>
            <ProjectCard title={project.title} items={project.things}/>
        </div>
        )
    });
    return (
        <div className=" from-blue-800 to-purple-700 bg-gradient-to-r">
            <div className="lg:container mx-auto bg-white">
                <div className="p-10">
                    <h1 className="text-7xl font-bold text-purple-700 text-center">Projects</h1>
                    <div className="flex flex-wrap mt-24 gap-2">
                        {projectCards}
                    </div>
                </div>

            </div>
        </div>
    )
}
